import React from 'react';
import Form from './Form';

import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <Router>
    <div className="App">
      <h1>React Form</h1>
      <Form />
    </div>
    </Router>
  );
}

export default App;
